declare @TenantID int
set @TenantID = 9

/*Projects*/

--update mislabeled program
UPDATE dbo.IdahoData
SET PrimaryProgram = 'Cropland Nutrient/Pesticide Management'
WHERE PrimaryProgram = 'Cropland Nutrient Management'

--update non-unique project names
UPDATE
	id
SET
	id.ProjectName = newnames.ProjectName + '-' + cast(newnames.rownum as varchar(1))
FROM
dbo.IdahoData id
INNER JOIN 
	(SELECT ProjectName, 
	ImplementationStartYear,
	row_number() OVER (
	partition by ProjectName
	order by ImplementationStartYear) as rownum
	FROM dbo.IdahoData
	) newnames
on id.ProjectName = newnames.ProjectName and id.ImplementationStartYear = newnames.ImplementationStartYear
WHERE newnames.rownum = '2'

--CHECK
--SELECT * FROM dbo.IdahoData WHERE right(ProjectName,2) = '-2'

--convert lat/long to geometry

SELECT
ProjectName,
latitude,
substring(Latitude,1,3) as latdegr,
substring(Latitude,5,2) as latmins,
CASE WHEN charindex('"',latitude) = 12 THEN substring(Latitude,8,4) 
	WHEN charindex('"',latitude) = 13 THEN substring(Latitude,8,5)
	ELSE NULL END as latsecs,
longitude,
substring(longitude,1,3) as longdegr,
substring(longitude,5,2) as longmins,
CASE WHEN charindex('"',longitude) = 12 THEN substring(longitude,8,4) 
	WHEN charindex('"',longitude) = 13 THEN substring(longitude,8,5)
	ELSE NULL END as longsecs
INTO #latlong
FROM dbo.IdahoData

SELECT ProjectName,
latdegr + cast(latmins as float)/60 + cast(latsecs as float)/3600 as decimal_latitude,
longdegr + cast(longmins as float)/60 + cast(longsecs as float)/3600 as decimal_longitude,
geometry::STPointFromText('POINT(' +
	CAST(-1*(longdegr + cast(longmins as float)/60 + cast(longsecs as float)/3600) as VARCHAR(20)) + ' ' +
	CAST(latdegr + cast(latmins as float)/60 + cast(latsecs as float)/3600 as VARCHAR(20)) + ')',
	4326) as ProjectPoint
INTO #geom
FROM #latlong

DROP TABLE #latlong

UPDATE dbo.IdahoData
SET ImplementationStartYear = year(CAST(ImplementationStartYear as smalldatetime))
WHERE len(ImplementationStartYear) > 4


INSERT INTO dbo.Project(TenantID,TaxonomyLeafID,ProjectStageID,ProjectName,ProjectDescription,ImplementationStartYear,CompletionYear,EstimatedTotalCost,ProjectLocationPoint,IsFeatured,PlanningDesignStartYear,ProjectLocationSimpleTypeID,FundingTypeID,ProjectApprovalStatusID)
SELECT
@TenantID,
lf.TaxonomyLeafID,
stg.ProjectStageID,
id.ProjectName,
id.ProjectDescription,
id.ImplementationStartYear,
id.CompletionYear,
CASE WHEN ft.FundingTypeID = 1 THEN round(id.EstimatedTotalCost,0)
	WHEN ft.FundingTypeID = 2 THEN NULL
	END as EstimatedTotalCost,
#geom.ProjectPoint,
0,
id.PlanningDesignStartYear,
1,
1 as FundingTypeID, --forcing all to be one-time since that's how the expenditure and PM data is structured, even if they think of them as ongoing projects
3
FROM
dbo.IdahoData id
INNER JOIN dbo.TaxonomyLeaf lf
on lf.TenantID = @TenantID and id.PrimaryProgram = lf.TaxonomyLeafName
INNER JOIN dbo.ProjectStage stg
on stg.ProjectStageDisplayName = id.ProjectStage
INNER JOIN dbo.FundingTypeData ft
on ft.TenantID = 9 and ft.FundingTypeDisplayName = id.FundingType
INNER JOIN #geom
on id.ProjectName = #geom.ProjectName
LEFT JOIN dbo.Project p on p.TenantID = @TenantID and p.ProjectName = id.ProjectName --this excludes existing projects
WHERE p.ProjectName IS NULL 

drop table #geom

