INSERT INTO dbo.PerformanceMeasureActual(TenantID,ProjectID,PerformanceMeasureID,CalendarYear,ActualValue)
SELECT @TenantID,
p.ProjectID,
CASE WHEN id.ProjectDescription = '15 year enrollment reducing cropland groundwater consumptive use.' THEN @crep_pm
	ELSE pm.PerformanceMeasureID END as PerformanceMeasureID,
cast(id.ImplementationStartYear as int),
cast(id.Units as decimal(10))
FROM dbo.IdahoData id
INNER JOIN dbo.Project p 
on id.ProjectName = p.ProjectName
LEFT JOIN dbo.PerformanceMeasure pm 
on id.ProjectDescription + ' (' + id.UnitMeasure + ')' = pm.PerformanceMeasureDisplayName 

