--assign subcategories and options to new PM Actuals

INSERT INTO dbo.PerformanceMeasureActualSubcategoryOption(TenantID, PerformanceMeasureActualID, PerformanceMeasureID, PerformanceMeasureSubcategoryOptionID, PerformanceMeasureSubcategoryID)
SELECT DISTINCT @TenantID,
pma.PerformanceMeasureActualID,
pma.PerformanceMeasureID,
sco.PerformanceMeasureSubcategoryOptionID,
sc.PerformanceMeasureSubcategoryID
FROM dbo.PerformanceMeasureActual pma
INNER JOIN dbo.PerformanceMeasureSubcategory sc
on pma.PerformanceMeasureID = sc.PerformanceMeasureID
INNER JOIN dbo.PerformanceMeasureSubcategoryOption sco
on sco.PerformanceMeasureSubcategoryOptionName = 'Default' and sc.PerformanceMeasureSubcategoryID = sco.PerformanceMeasureSubcategoryID
LEFT JOIN dbo.PerformanceMeasureActualSubcategoryOption asco 
on pma.PerformanceMeasureActualID = asco.PerformanceMeasureActualID
WHERE pma.TenantID = @TenantID and asco.PerformanceMeasureActualSubcategoryOptionID IS NULL

