/*From other fed/local match */
INSERT INTO dbo.ProjectFundingSourceExpenditure(TenantID,ProjectID,FundingSourceID,CalendarYear,ExpenditureAmount)
SELECT 
@TenantID,
p.ProjectID,
fs.FundingSourceID,
id.ImplementationStartYear,
id.OtherFedLocalMatch
FROM dbo.IdahoData id
INNER JOIN dbo.Project p
on id.ProjectName = p.ProjectName
INNER JOIN #IDFundingSources idfs
on id.MatchSource = idfs.spreadsheet_name
INNER JOIN dbo.FundingSource fs
on idfs.PF_name = fs.FundingSourceName
WHERE id.OtherFedLocalMatch IS NOT NULL 

