/***Watersheds***/

--fix typo
UPDATE dbo.IdahoData
SET HUC = 17040212
WHERE HUC = 170404212

--add missing watershed
INSERT INTO dbo.Watershed(TenantID, WatershedName, WatershedFeature)
SELECT TOP 1 @TenantID, 
WatershedName,
WatershedFeature
FROM 
dbo.Watershed 
WHERE WatershedName LIKE '%17060106%'

INSERT INTO dbo.ProjectWatershed (TenantID, ProjectID, WatershedID)
SELECT 
@TenantID,
p.ProjectID,
w.WatershedID
FROM
dbo.IdahoData id
JOIN dbo.Watershed w
on w.TenantID = @TenantID and w.WatershedName LIKE '%' + cast(id.HUC as varchar(15)) + '%'
JOIN dbo.Project p 
on id.ProjectName = p.ProjectName
LEFT JOIN dbo.ProjectWatershed pw
on p.ProjectID = pw.ProjectID
WHERE pw.ProjectID IS NULL

